import React from "react";
import "../../sass/style.sass";
import equilibrium from "../../img/image-equilibrium.jpg";

class CardImage extends React.Component {
  render() {
    return;
    <div className="row">
      <img src={equilibrium} className="equilibrium" />;
    </div>;
  }
}

export default CardImage;
